The squad is taking over a nightclub. It’s time to be bold, take space, and MOVE.
@lacitymunicipaldancesquad
#dancingstories

The squad is excited for next week’s big dance night, and we join them at rehearsals. Angela explains the importance of female friendship.
@lacitymunicipaldancesquad
#dancingstories

The L.A. City Municipal Dance Squad is a group of eleven women creating a community around dance, committing to challenge themselves and all of us to be bold and explore our weird sides. In our co-created miniseries, we follow the squad as they take over a nightclub to let loose in a way they’ve never done before.
@lacitymunicipaldancesquad
